import React from "react";
import { Heading, View, Card, Divider } from "@aws-amplify/ui-react";
import { DriverCardCollection } from "../ui-components";

function SponsorViewApplicationsPage() {
	return (
		<View className="SponsorViewApplicationsPage">
			<Card>
				<Heading level={1}>Your Driver Applications:</Heading>
				<div style={{
					display: 'flex',
					justifyContent: 'center',
					alignItems: 'center',
					height: '95vh'
						}}>
					<DriverCardCollection />
				</div>
			</Card>
		</View>
	);
}
export default SponsorViewApplicationsPage;
